import React from 'react';
import './TopNavigation.css'

const TopNavigation = () => {
	return(
		<div className="gradient Rectangle2">
		  <p className="employee"> Employees </p>
		  <span>
		  <input className="searchbar" type="text" placeholder="Search.."/>
		  </span>
		</div>
		);
};

export default TopNavigation;
